-- Aircraft brands
create table aircraft_brands
(
    id   serial       not null
        constraint aircraft_brand_pk
            primary key,
    name varchar(255) not null
);

alter table aircraft_brands
    owner to postgres;


-- Aircraft models
create table aircraft_models
(
    id        serial  not null
        constraint aircraft_model_pk
            primary key,
    name      varchar(512),
    brand_idx integer not null
        constraint brand_fk
            references aircraft_brands
);

alter table aircraft_models
    owner to postgres;


-- Countries
create table countries
(
    id   serial       not null
        constraint countries_pk
            primary key,
    name varchar(512) not null
);

alter table countries
    owner to postgres;


-- Cities
create table cities
(
    id          serial       not null
        constraint cities_pk
            primary key,
    name        varchar(512) not null,
    country_idx integer      not null
        constraint country_fk
            references countries
);

alter table cities
    owner to postgres;


-- Airports
create table airports
(
    id         serial  not null
        constraint airports_pk
            primary key,
    name       varchar(255),
    short_code varchar(3),
    city_idx   integer not null
        constraint city_fk
            references cities
);

alter table airports
    owner to postgres;


--Aircrafts
create table aircrafts
(
    id                serial       not null
        constraint aircraft_pk
            primary key,
    registration      varchar(128) not null,
    home_airport_idx  integer      not null
        constraint home_airport_fk
            references cities,
    model_idx         integer      not null
        constraint model_fk
            references aircraft_models,
    seats_nb          integer      not null,
    construction_date date         not null
);

alter table aircrafts
    owner to postgres;


-- Employee functions
create table employee_functions
(
    id   serial       not null
        constraint employee_functions_pk
            primary key,
    name varchar(128) not null
);

alter table employee_functions
    owner to postgres;


-- Employees
create table employees
(
    id                    serial       not null
        constraint employees_pk
            primary key,
    first_name            varchar(255) not null,
    last_name             varchar(255) not null,
    birthday              timestamp    not null,
    employed_since        date         not null,
    home_city_idx         integer      not null
        constraint home_city_fk
            references cities,
    employee_function_idx integer
);

alter table employees
    owner to postgres;


--Flights
create table flights
(
    id               serial  not null
        constraint flights_pk
            primary key,
    from_city        integer not null
        constraint from_city_fk
            references cities,
    to_city          integer not null
        constraint to_city_fk
            references cities,
    std_duration_sec integer not null,
    aircraft_idx     integer
);

alter table flights
    owner to postgres;


-- Flights employees
create table flights_employees
(
    employee_idx integer not null
        constraint employee_fk
            references employees,
    flight_idx   integer not null
        constraint flight_fk
            references flights,
    constraint flights_employees_pk
        primary key (employee_idx, flight_idx)
);

alter table flights_employees
    owner to postgres;

